import { Ticket } from '../models/ticket';
import { Major } from '../models/enum';


const dateToday: Date = new Date();

export const TICKETS_MOCKED: Ticket[] = [
  {
    title: 'SI4 in Madrid',
    description: '',
    date: dateToday,
    student: 'Paul',
    major: Major.SI
    archived: false
  },
  {
    title: 'TEST',
    description: 'Description du voyage',
    date: dateToday,
    student: 'Anakin',
    major: Major.GE
  },
];
